import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
import {
  selectCurrentUser,
  selectOnEdit,
} from "../../redux/user/user.selector";
import CusButton from "../../component/cus-button/cus-button.component";
import { onUserProfileEdite } from "../../redux/user/user.action";
import "./profile.style.scss";

const Profile = ({ currentUser, selectOnEdit, onEdite }) => {
  const { email, displayName } = currentUser;
  return (
    <div>
      <div>{selectOnEdit ? <div>hello</div> : <div>hi</div>}</div>
      <button onClick={() => console.log(email)}>press </button>
    </div>
  );
};
const mapDispatchToProps = (dispatch) => ({
  OnEdite: () => dispatch(onUserProfileEdite()),
});
const mapStateToProps = createStructuredSelector({
  currentUser: selectCurrentUser,
  selectOnEdit: selectOnEdit,
});
export default connect(mapStateToProps, mapDispatchToProps)(Profile);
